INSERT INTO `RESTAURANTS` VALUES (32,'Restaurant Gordon Ramsay','A must for the culinary connoisseur, Restaurant Gordon Ramsay offers exquisitely simply French cuisine, creative flair and a delicate finesse.','2 Battersea Rises','EC1V 7JX','London','England',51.530702,-0.105575,'q','q','q','q','2016-01-10 21:58:08','2016-04-03 20:56:51','http://res.cloudinary.com/serveme/image/upload/v1456332056/uniaiquscywcid8cdyk4.jpg',0,'-1',NULL,13.00,0,5),(33,'Holy Smokes','Holy Smokes is the best test restaurant ever.','5, Surrey water road','SE16 5PH','London','England',51.503506,-0.045176,'support@holysmoke.com','admin@holysmoke.com','222222222','1111111111','2016-01-19 02:18:17','2016-05-15 06:24:48','http://res.cloudinary.com/serveme/image/upload/v1458391908/pxy5yqhys3jpvryi0tfd.jpg',0,'-1',NULL,12.50,1,6),(34,'The Five Fields','Chef Patron Taylor Bonnyman, working in collaboration with Head Chef Marguerite Keogh, offer elegant and playful modern British cooking with an emphasis on native British artisanal produce.','8-9 Blacklands Terrace','EC1R 1UX','London','England',51.530394,-0.106020,'5','5','5','55','2016-01-19 02:30:55','2016-03-29 05:53:39','http://s3.amazonaws.com/stnd-narcissa-prod/graphics/assets/000/000/026/medium/narcissa_night_january_2014_cwmosier-5.jpg',0,'-1',NULL,13.00,0,5),(35,'The Ledbury','An exquisite seasonal menu with each dish bursting with flavour.','127 Ledbury Rd','SE16 6BY','London','England',51.502542,-0.042926,'ffa','ff','d','d','2016-01-19 03:10:07','2016-04-25 17:28:47','http://img2.10bestmedia.com/Images/Photos/323662/The-American-Restaurant---photo-by-Bonjwing-Lee_54_990x660.jpg',0,'-1',NULL,13.00,0,5),(36,'Heliot Steak House','Voted Best Steak Restaurant in London by Bookatable users, Heliot Steak House offers panoramic views of the main gaming floor at the Hippodrome Casino.','The Hippodrome Casino, Cranbourn Street','WC2H 7JH','London','England',51.511466,-0.129042,'11','1','11','11','2016-01-20 02:21:12','2016-03-29 05:54:39','http://www.papannis.com/img/restaurant.jpg',0,'-1',NULL,13.00,0,5),(38,'The Gate','Established in 1989','51 Queen Caroline Street','EC1V 4NN','London','England',51.530437,-0.105312,' ',' ','0909009090','111111111','2016-03-03 01:14:44','2016-03-29 04:45:04','http://thegaterestaurants.com/wp-content/uploads/2015/07/banner_one-300x82.jpg',0,'-1',NULL,13.00,0,5),(40,'Niche Food And Drink','Niche is an independently owned casual dining restaurant near Sadler\'s Wells Theatre and Angel Tube Station in Islington,  serving good honest British comfort food with a modern twist. Our \'niche\' is that everything on our menu is 100% Gluten-free, but you wouldn\'t know it!','Niche 197-199 Rosebery Av London','EC1R 4TJ','London','England',51.529787,-0.105757,'niche@gmail.com','niche@gmail.com','020 7837 5048','020 7837 5048','2016-04-26 04:49:20','2016-05-05 16:55:20','http://res.cloudinary.com/serveme/image/upload/v1461652768/negnxlwdffvtto1ctrmd.png',0,'-1',NULL,12.50,0,5);
